import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return(
                <footer >
                    <a  href="automacaocuritiba.com.br">
                        <img id="linkedin-icon" className="social-icon"/>
                    </a>

                    <a>
                        <img id="github-icon" className="social-icon"/>
                    </a>

                    <a>
                        <img id="whatsapp-icon" className="social-icon"/>
                    </a>
                </footer>
        )
    }
}

export default Footer;
